export default function GetFeed(doc){
    const container = doc.getElementById("PagesProfileHomePrimaryColumnPagelet");
    const pagePhotos = doc.getElementById("page_photos");
    if(container){
        const feed = container.firstChild.childNodes[1].firstChild.childNodes[1].innerHTML;
        return feed
    }
    else{
        return []
    }
}
